import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-white shadow-md fixed w-full top-0 z-50">
      <div className="container mx-auto flex justify-between items-center py-4 px-6">
        <h1 className="text-2xl font-bold text-blue-600">FinanceCo</h1>
        <ul className="hidden md:flex space-x-6 text-gray-700 font-medium">
          <li><a href="#services" className="hover:text-blue-600">Services</a></li>
          <li><a href="#whyus" className="hover:text-blue-600">Why Us</a></li>
          <li><a href="#process" className="hover:text-blue-600">Process</a></li>
          <li><a href="#testimonials" className="hover:text-blue-600">Testimonials</a></li>
          <li><a href="#faq" className="hover:text-blue-600">FAQ</a></li>
          <li><a href="#contact" className="hover:text-blue-600">Contact</a></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
